  - id: 37
    name: Search for a Page
    description: ''
    sql: "select distinct \r\n\r\n'[' || alsip.title || ']' ||\r\n'(/content/page/'
      || sip.study_info_id || '/' || alsip.slug || ')' result\r\n,\r\n\r\nCASE \r\nWHEN
      sps.title ~* :search OR sps.content ~* :search\r\nTHEN sps.title || '\r\n' ||
      left(sps.content, 400)\r\nWHEN alsip.title ~* :search OR alsip.description ~*
      :search\r\nTHEN alsip.title || '\r\n' || left(alsip.description, 400)\r\nWHEN
      nssf.title ~* :search OR nssf.description ~* :search\r\nTHEN nssf.title || '\r\n'
      || left(nssf.description, 400)\r\nEND\r\ndescription\r\n\r\nfrom activity_log_study_info_parts
      alsip\r\n\r\ninner join study_info_parts sip\r\non sip.master_id = alsip.master_id\r\n\r\nleft
      join model_references mr\r\non \r\n  NOT coalesce(mr.disabled, false)  \r\n
      \ AND mr.from_record_type = 'ActivityLog::StudyInfoPart'\r\n  AND mr.to_record_type
      = 'DynamicModel::StudyPageSection'\r\n  AND alsip.id = mr.from_record_id\r\n
      \ \r\nleft join study_page_sections sps\r\non\r\n  sps.id = mr.to_record_id\r\n\r\nleft
      join model_references mr2\r\non \r\n  NOT coalesce(mr2.disabled, false)  \r\n
      \ AND mr2.from_record_type = 'ActivityLog::StudyInfoPart'\r\n  AND mr2.to_record_type
      = 'NfsStore::Manage::Container'\r\n  AND alsip.id = mr2.from_record_id\r\n  \r\nleft
      join nfs_store_containers nsc\r\non\r\n  nsc.id = mr2.to_record_id\r\n\r\nleft
      join nfs_store_stored_files nssf\r\non\r\n  nssf.nfs_store_container_id = nsc.id\r\n\r\nwhere
      \r\nalsip.title ~* :search\r\nOR alsip.description ~* :search\r\n\r\nOR sps.title
      ~* :search\r\nOR sps.content ~* :search\r\n\r\nOR nssf.title ~* :search\r\nOR
      nssf.description ~* :search\r\n\r\n\r\nLIMIT 20;\r\n"
    search_attrs: "\r\n\r\nsearch: \r\n  text: \r\n    all: true\r\n    multiple:
      single\r\n    disabled: false"
